import{f as e}from"./app.04f9bf74.js";import{_ as o}from"./plugin-vue_export-helper.21dcd24c.js";const i={},t=e('<h1 id="generation-behaviors" tabindex="-1"><a class="header-anchor" href="#generation-behaviors" aria-hidden="true">#</a> Generation Behaviors</h1><p>Besides understanding <code>go-doudou</code> CLI flags and subcommands usage, you should also know generation behaviors on generated files. I group them into three kind of behaviors <code>Incremental Generation</code>, <code>Overwritten Generation</code> and <code>Skip Generation</code>.</p><h2 id="incremental-generation" tabindex="-1"><a class="header-anchor" href="#incremental-generation" aria-hidden="true">#</a> Incremental Generation</h2><ul><li><p><code>svcimpl.go</code>: Every time you run <code>go-doudou svc http</code>, existing code in it will not be overwritten, only new code will be appended to the end. So you can feel free to remove the generated code and write your own to fit your need. You will not lost any code, even rerun this command again and again as your will.</p></li><li><p><code>transport/httpsrv/handlerimpl.go</code>: Every time you run <code>go-doudou svc http</code> with <code>--handler</code> flag, existing code in it will not be overwritten, only new code will be appended to the end. So you can feel free to remove the generated code and write your own to fit your need. You will not lost any code, even rerun this command again and again as your will.</p></li><li><p><code>client/clientproxy.go</code>: Every time you run <code>go-doudou svc http</code> with <code>-c</code> flag, existing code in it will not be overwritten, only new code will be appended to the end. So you can feel free to remove the generated code and write your own to fit your need. You will not lost any code, even rerun this command again and again as your will.</p></li></ul><h2 id="overwritten-generation" tabindex="-1"><a class="header-anchor" href="#overwritten-generation" aria-hidden="true">#</a> Overwritten Generation</h2><ul><li><p><code>transport/httpsrv/handler.go</code>: Every time you run <code>go-doudou svc http</code>, existing code in it will be overwritten. So don&#39;t edit it.</p></li><li><p><code>client/client.go</code>: Every time you run <code>go-doudou svc http</code> with <code>-c</code> flag, existing code in it will be overwritten. So don&#39;t edit it.</p></li><li><p><code>client/iclient.go</code>: Every time you run <code>go-doudou svc http</code> with <code>-c</code> flag, existing code in it will be overwritten. So don&#39;t edit it.</p></li><li><p><code>${service}_openapi3.go</code>: Every time you run <code>go-doudou svc http</code> with <code>--doc</code> flag, existing code in it will be overwritten. So don&#39;t edit it.</p></li><li><p><code>${service}_openapi3.json</code>: Every time you run <code>go-doudou svc http</code> with <code>--doc</code> flag, existing code in it will be overwritten. So don&#39;t edit it.</p></li></ul><h2 id="skip-generation" tabindex="-1"><a class="header-anchor" href="#skip-generation" aria-hidden="true">#</a> Skip Generation</h2><p>The other files will be skipped if they have been already generated.</p>',8);function n(d,r){return t}var l=o(i,[["render",n]]);export{l as default};
